column39:
Either 
sub do_something( @a, $b, $c ) {...}
Or 
sub do_something( @a, Int $b, Int $c ) {...}
If you want to be more picky.

By using @a you're defining you want a Positional object as the first argument which your $a is. Raku doesn't have the idea of references the way Perl does

